import React from "react";
import styles from "../scss/NewestPost.module.scss";
import { Row, Col } from "react-bootstrap";
const NewestPost = () => {
  return (
    <Row className={styles.row}>
      <Col xs={12} sm={12} md={6} lg={6} className={`${styles.col} ${styles.newest}`}>
        <img src={require("../../img/images/banner-cut.png").default} alt="" />
        <p>G-STORE – THỜI ĐIỂM VÀNG ĐỂ ĐẨY MẠNH KINH DOANH ONLINE</p>
        <p>
          Ngày nay dịch bệnh đang diễn ra phức tạp và khó có thể lường trước
          được. Thay vì chìm đắm trong sự bối rối, những doanh nghiệp bình tĩnh
          đối phó, ứng dụng thành thạo được công cụ kinh doanh…
        </p>
      </Col>
      <Col xs={12} sm={12} md={5} lg={5} className={styles.col}>
        <div>
          <img src={require("../../img/images/banner-cut.png").default} />
        </div>
      </Col>
    </Row>
  );
};

export default NewestPost;
